import React, { Component } from 'react'
import hello from './index.module.css'

export default class Hello extends Component {
    state = {}
    render() {
        return (
            <h2 className={ hello.title }>
                Hello React!!
            </h2>
        );
    }
}
import moduleName from 'module'
